import React from 'react';
import { useParams, Route } from "react-router-dom"; // Import Route
import SimpleSlider from './simpleSlider'; // Import SimpleSlider component
import product from './components/product';// Import Product component
import ProductPage from "./ProductPage"; // Import ProductPage component

function Home() {
    const { fname } = useParams();
    return (
        <div>
            <h2>{fname}</h2>
            <SimpleSlider /> {/* Include SimpleSlider component here */}
            <Route path="/product" element={<ProductPage />} /> {/* Render ProductPage component */}
            <product /> {/* Include Product component here */}
        </div>
    );
}

export default Home;
